import React, {Component} from "react";
import logo from "../../images/лого.svg";
import waves from "../../images/waves.png";

export class Footer extends Component {
    render() {
        return (
            <footer className="footer">
                <div className="footer__container-title">
                    <img className="footer__logo" src={logo} alt=""/>
                    <div className="footer__title">
                        <p>Кофе с ароматом моря</p>
                        <img src={waves} alt=""/>
                    </div>
                </div>
                <div className="footer__container-info">
                    <div className="footer__price">
                        <div className="footer__price-retail">
                            <p className="footer__price-retail-title">Розница</p>
                            <a className="footer__price-retail-desc">Доставка и оплата</a>
                        </div>

                    </div>
                </div>
            </footer>
        )
    }
}
